import { ClientCardData } from './clientCardData';
import { ClientCardOptions } from './clientCardOptions';

import '../styles/rutesListComponentStyle.css';


export const RuteListComponent = ({ rutesList, setRutesList, rutesCompleted, setRutesCompleted }) => {

  
    
  return (
    <>
        <section className = 'RutesListContainer'>

          { rutesList.map( (e)=>
          
            <div key = { e.directionRute } className='clientCard'>

              <ClientCardData clientData = { e }/>

              <ClientCardOptions  clientData = { e } 
                                  setRutesList = { setRutesList } 
                                  rutesList = { rutesList }
                                  rutesCompleted = { rutesCompleted }
                                  setRutesCompleted = { setRutesCompleted }/>

            </div>
          
          ) }

        </section>
    </>
   
  )
}
